"use strict";(self.webpackChunkobsidian=self.webpackChunkobsidian||[]).push([[1788],{2602:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"git-como-recuperar-um-stash-perdido","metadata":{"permalink":"/obsidian/blog/git-como-recuperar-um-stash-perdido","source":"@site/blog/2023-11-03-git-como-recuperar-um-stash-perdido.md","title":"Como recuperar um stash perdido no Git?","description":"Aprenda como recuperar um stash perdido no Git e restaurar as altera\xe7\xf5es importantes que voc\xea pode ter arquivado.","date":"2023-11-03T00:00:00.000Z","formattedDate":"3 de novembro de 2023","tags":[{"label":"git","permalink":"/obsidian/blog/tags/git"},{"label":"git-como-recuperar-um-stash-perdido","permalink":"/obsidian/blog/tags/git-como-recuperar-um-stash-perdido"},{"label":"stash","permalink":"/obsidian/blog/tags/stash"}],"readingTime":1.04,"hasTruncateMarker":false,"authors":[{"name":"Willian Luis Zuqui","title":"Willian Luis Zuqui","url":"https://github.com/zuqui","image_url":"https://github.com/wzuqui.png","imageURL":"https://github.com/wzuqui.png"}],"frontMatter":{"title":"Como recuperar um stash perdido no Git?","description":"Aprenda como recuperar um stash perdido no Git e restaurar as altera\xe7\xf5es importantes que voc\xea pode ter arquivado.","slug":"git-como-recuperar-um-stash-perdido","authors":[{"name":"Willian Luis Zuqui","title":"Willian Luis Zuqui","url":"https://github.com/zuqui","image_url":"https://github.com/wzuqui.png","imageURL":"https://github.com/wzuqui.png"}],"tags":["git","git-como-recuperar-um-stash-perdido","stash"],"hide_table_of_contents":false},"nextItem":{"title":"Diferen\xe7a entre processamento em lote ou granular","permalink":"/obsidian/blog/diferenca-entre-processamento-em-lote-ou-granular"}},"content":"## 1. Encontre o stash\\n\\n```bash\\ngit log --graph --oneline --decorate $(git fsck --no-reflog | awk \'/dangling commit/ {print $3}\')\\n```\\n\\n_Isso mostrar\xe1 todos os commits nas pontas do seu gr\xe1fico de commit que n\xe3o s\xe3o mais referenciados por nenhum branch ou tag \u2013 cada commit perdido, incluindo cada stash commit que voc\xea j\xe1 criou, estar\xe1 em algum lugar desse gr\xe1fico_\\n\\n## 2. Depois de saber o hash do commit desejado, voc\xea pode aplic\xe1-lo como um stash\\n\\n```bash\\ngit stash apply SEU_WIP_COMMIT_HASH_AQUI\\n```\\n\\n_**Nota:** A mensagem de commit s\xf3 estar\xe1 neste formato (come\xe7ando com \\"WIP on\\") se voc\xea n\xe3o forneceu uma mensagem quando fez git stash._\\n\\n**Fonte:** Veja a resposta completa em https://stackoverflow.com/a/91795/2510591\\n\\n## 3. Se o seu stash commit n\xe3o estiver listado ou voc\xea n\xe3o o encontrar (opcional)\\n\\nSe o seu stash j\xe1 foi aplicado, mas voc\xea n\xe3o o v\xea, por exemplo, ap\xf3s resolver um conflito ou reiniciar. Siga esses passos:\\n\\n- Execute `bash git fsck --no-reflog | awk \'/dangling commit/ {print $3}\'`\\n- Escolha um hash de commit stash e use `git show COMMIT_HASH` para examinar o stash commit diff de suas altera\xe7\xf5es.\\n- Depois de encontrar suas altera\xe7\xf5es, basta usar o commit correspondente das altera\xe7\xf5es do seu stash e aplic\xe1-lo usando `git stash apply COMMIT_HASH`."},{"id":"diferenca-entre-processamento-em-lote-ou-granular","metadata":{"permalink":"/obsidian/blog/diferenca-entre-processamento-em-lote-ou-granular","source":"@site/blog/2023-09-29-diferenca-entre-processamento-em-lote-ou-granular.md","title":"Diferen\xe7a entre processamento em lote ou granular","description":"Algumas diferen\xe7as encontradas com o time de desenvolvimento entre processamento em lote ou granular","date":"2023-09-29T00:00:00.000Z","formattedDate":"29 de setembro de 2023","tags":[{"label":"banco-de-dados","permalink":"/obsidian/blog/tags/banco-de-dados"},{"label":"change-track","permalink":"/obsidian/blog/tags/change-track"},{"label":"concorrencia","permalink":"/obsidian/blog/tags/concorrencia"},{"label":"cursor","permalink":"/obsidian/blog/tags/cursor"},{"label":"diferenca-entre-processamento-em-lote-ou-granular","permalink":"/obsidian/blog/tags/diferenca-entre-processamento-em-lote-ou-granular"},{"label":"efcore","permalink":"/obsidian/blog/tags/efcore"},{"label":"granular","permalink":"/obsidian/blog/tags/granular"},{"label":"lock lote","permalink":"/obsidian/blog/tags/lock-lote"},{"label":"select","permalink":"/obsidian/blog/tags/select"},{"label":"selects","permalink":"/obsidian/blog/tags/selects"},{"label":"sql","permalink":"/obsidian/blog/tags/sql"},{"label":"transactions","permalink":"/obsidian/blog/tags/transactions"},{"label":"worker","permalink":"/obsidian/blog/tags/worker"},{"label":"workers","permalink":"/obsidian/blog/tags/workers"}],"readingTime":1.905,"hasTruncateMarker":false,"authors":[{"name":"Willian Luis Zuqui","title":"Willian Luis Zuqui","url":"https://github.com/zuqui","image_url":"https://github.com/wzuqui.png","imageURL":"https://github.com/wzuqui.png"}],"frontMatter":{"title":"Diferen\xe7a entre processamento em lote ou granular","description":"Algumas diferen\xe7as encontradas com o time de desenvolvimento entre processamento em lote ou granular","slug":"diferenca-entre-processamento-em-lote-ou-granular","authors":[{"name":"Willian Luis Zuqui","title":"Willian Luis Zuqui","url":"https://github.com/zuqui","image_url":"https://github.com/wzuqui.png","imageURL":"https://github.com/wzuqui.png"}],"tags":["banco-de-dados","change-track","concorrencia","cursor","diferenca-entre-processamento-em-lote-ou-granular","efcore","granular","lock lote","select","selects","sql","transactions","worker","workers"],"hide_table_of_contents":false},"prevItem":{"title":"Como recuperar um stash perdido no Git?","permalink":"/obsidian/blog/git-como-recuperar-um-stash-perdido"}},"content":"## Motiva\xe7\xe3o\\n\\nA motiva\xe7\xe3o deste post \xe9 compartilhar algumas diferen\xe7as encontradas com o time de desenvolvimento entre processamento em lote ou granular. Com o objetivo de ajudar a entender qual a melhor forma de processar os dados.\\n\\nCom o passar do tempo desenvolvendo aplica\xe7\xf5es `workers` que s\xe3o aplicativos que processam dados em segundo plano, percebi que existem duas formas de processar os dados, em lote ou granular, com eles suas vantagens e desvantagens que ser\xe3o abordadas neste post.\\n\\n## Processamento em lote\\n\\nO processamento em lote \xe9 quando voc\xea processa um conjunto de dados de uma vez s\xf3, por exemplo, voc\xea tem uma lista de 1000 usu\xe1rios e precisa enviar um e-mail para cada um deles, voc\xea pode processar todos de uma vez s\xf3, ou seja, em lote.\\n\\n## Processamento granular\\n\\nO processamento granular \xe9 quando voc\xea processa um conjunto de dados de forma granular, ou seja, um por um, por exemplo, voc\xea tem uma lista de 1000 usu\xe1rios e precisa enviar um e-mail para cada um deles, voc\xea pode processar um por um, ou seja, de forma granular.\\n\\n## Tabela comparativa\\n\\n| Processamento granular                                                            | Processamento em lote                                                                | Vantagem |\\n| --------------------------------------------------------------------------------- | ------------------------------------------------------------------------------------ | :------: |\\n| Muito `selects` executados no banco de dados                                      | Menos selects executados no banco                                                    |   Lote   |\\n| `SQL` com menos par\xe2metros                                                        | `SQL` com acima de 2.100 par\xe2metros causam erros de execu\xe7\xe3o                         | Granular |\\n| Caso aconte\xe7a um erro, voc\xea pode identificar em qual registro parou sua aplica\xe7\xe3o | Perde a `transactions` inteira do lote                                               | Granular |\\n| Salva o `cursor`/`posi\xe7\xe3o` na qual o registro est\xe1 seja ele com erro ou sucesso   | O `cursor` n\xe3o consegue identificar o real problema, e salva o cursor somente no fim | Granular |\\n| Conseguimos identificar o tempo de processamento de cada registro                 | Conseguimos apenas a m\xe9dia de tempo para cada registro                               | Granular |\\n| Menos `concorr\xeancia` e `change track` no `efcore`                                 | Mais `concorr\xeancia` gerando mais `lock` no banco                                     | Granular |\\n\\n> Placar final: Granular 6 x 1 com vantagem para o processamento granular\\n\\n## Conclus\xe3o\\n\\nConforme for passando o tempo, e novas experi\xeancias forem surgindo, vou atualizando este post com novas informa\xe7\xf5es. Mas por enquanto, a melhor forma de processar os dados \xe9 de forma granular."}]}')}}]);